import Papa from "papaparse";
import * as XLSX from "xlsx";

export const parseExcel = (input) => {
  return new Promise((resolve, reject) => {
    // Function to read and parse the workbook
    const processWorkbook = (workbook) => {
      const sheetName = workbook.SheetNames[0];
      const sheetData = XLSX.utils.sheet_to_csv(workbook.Sheets[sheetName]);

      Papa.parse(sheetData, {
        header: true,
        dynamicTyping: true,
        complete: (results) => {
          let data = results.data;
          resolve(data);
        },
        error: (error) => {
          reject(error);
        },
      });
    };

    // Check if the input is a File object (from a file input)
    if (input instanceof File) {
      const reader = new FileReader();
      reader.onload = (event) => {
        const data = new Uint8Array(event.target.result);
        const workbook = XLSX.read(data, { type: "array" });
        processWorkbook(workbook);
      };
      reader.readAsArrayBuffer(input);
    }
    // Else, assume it's a file path
    else if (typeof input === "string") {
      fetch(input)
        .then((res) => res.arrayBuffer())
        .then((buffer) => {
          const workbook = XLSX.read(new Uint8Array(buffer), { type: "array" });
          processWorkbook(workbook);
        })
        .catch((error) => {
          reject(error);
        });
    } else {
      reject(
        new Error(
          "Invalid input: Input should be a File object or a file path string."
        )
      );
    }
  });
};

export const parseCsv = (input) => {
  return new Promise((resolve, reject) => {
    const parseOptions = {
      header: true,
      dynamicTyping: true,
      complete: (results) => {
        let data = [];
        if (results.errors.length > 0) {
          const validData = results.data.filter(
            (_, index) => !results.errors.some((error) => error.row === index)
          );
          data = validData;
        } else {
          data = results.data;
        }

        const temp = data.map((row) => {
          const modifiedRow = { ...row };
          if (modifiedRow[""]) {
            modifiedRow[`Unnamed Column`] = modifiedRow[""];
            delete modifiedRow[""];
          }
          return modifiedRow;
        });
        resolve(temp);
      },
      error: (error) => {
        reject(error);
      },
    };

    // Check if the input is a File object
    if (input instanceof File) {
      Papa.parse(input, parseOptions);
    }
    // Otherwise, assume it's a file path
    else if (typeof input === "string") {
      fetch(input)
        .then((response) => response.text())
        .then((csvString) => {
          Papa.parse(csvString, { ...parseOptions, download: false });
        })
        .catch((error) => {
          reject(error);
        });
    } else {
      reject(
        new Error(
          "Invalid input: Input should be a File object or a file path string."
        )
      );
    }
  });
};

